import React from 'react';
import './PopCardStyles.scss';

const PopCard = ({id, name, song, album, date}) => (
	<div className='bg-light-green dib br3 pa1 ma2 grow bw2 shadow-5'>
		<h2>{name}</h2>
		<h2>{song}</h2>
		<h4>{album}</h4>
		<p>{date}</p>
	</div>
)

export default PopCard;
